	add("foray", "{\"term\":\"foray\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"frankish\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\", \"Icelandic\", \"Dutch\"], \"text\":\"From Middle english (1100-1500) \u0027forrayen\u0027 (to pillage) a back-formation of \u0027forrayour\u0027 \u0027forreour\u0027 \u0027forrier\u0027 (raider, pillager) from Old french (842-ca. 1400) \u0027forrier\u0027 \u0027fourrier\u0027 () a derivative of \u0027fuerre\u0027 (provender, fodder, straw) from Frankish {{m|frk|*fōdar||fodder, sheath}}, from Proto-germanic {{m|gem-pro|*fōdrą||fodder, feed, sheath}}, from Proto-indo-european {{m|ine-pro|*patrom||fodder}}, {{m|ine-pro|*pat-||to feed}}, {{m|ine-pro|*pāy-||to guard, graze, feed}}. Cognate with Old high german (ca. 750-1050) \u0027fuotar\u0027 (German \u0027futter\u0027 (fodder, feed) , Old english (ca. 450-1100) {{m|ang|fōdor}}, {{m|ang|fōþor||food, fodder, covering, case, basket}}, Dutch \u0027voeder\u0027 (forage, food, feed) Danish \u0027foder\u0027 (fodder, feed) Icelandic \u0027fóður\u0027 (fodder, sheath) More at {{l|en|fodder}}, {{l|en|food}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sudden or irregular incursion in border warfare; hence, any irregular incursion for war or spoils; a raid\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A brief excursion or attempt, especially outside one\u0027s accustomed sphere\", \"priority\":2}]}, \"synonyms\":{}}");

