	add("forefather", "{\"term\":\"forefather\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old norse\"], \"text\":\"Possibly directly from Old norse \u0027forfaðir\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Ancestor.\u0026lt;sup\u0026gt;\u0026lt;/sup\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"His \u0027\u0027forefathers\u0027\u0027 had been, as a rule, professional men\u0026amp;mdash;physicians and lawyers; his grandfather died under the walls of Chapultepec Castle while twisting a tourniquet for a cursing dragoon; an uncle remained indefinitely at Malvern Hill; an only brother at Montauk Point having sickened in the trenches before Santiago\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Cultural ancestor; one who originated an idea or tradition\", \"priority\":3}]}, \"synonyms\":{}}");

