	add("forehead", "{\"term\":\"forehead\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) {{m|ang|forhēafod}}, corresponding to {{prefix|fore|head|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The part of the face above the eyebrows and below the hairline\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1865\u0027\u0027, \u0027\u0027, Macmilla\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This question the Dodo could not answer without a great deal of thought, and it sat for a long time with one finger pressed upon its \u0027\u0027forehead\u0027\u0027 (the position in which you usually see Shakespeare, in the pictures of him), while the rest waited in silence. At last the Dodo said, ‘everybody has won, and all must have prizes.’\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Serene, smiling, enigmatic, she faced him with no fear whatever showing in her dark eyes.She put back a truant curl from her \u0027\u0027forehead\u0027\u0027 where it had sought egress to the world, and looked him full in the face now, drawing a deep breath which caused the round of her bosom to lift the lace at her throat\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d17|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dThe face which emerged was not reassuring. It was blunt and grey, the nose springing thick and flat from high on the frontal bone of the \u0027\u0027forehead\u0027\u0027, whilst his eyes were narrow slits of dark in a tight bandage of tissue\", \"priority\":5}]}, \"synonyms\":{}}");

