	add("foreskin", "{\"term\":\"foreskin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The retractable fold of skin encompassing the most nerve-dense tissue in the human male, which naturally covers and protects the head of the penis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"And the uncircumcised man child whose flesh of his \u0027\u0027foreskin\u0027\u0027 is not circumcised, that soul shall be cut off from his people; he hath broken my covenant.\u0027\u0026amp;nbsp; \u0026amp;mdash; Genesis 17:14, the Christian Bible\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In primates, the \u0027\u0027foreskin\u0027\u0027 is present in the genitalia of both sexes and likely has been present for millions of years of evolution.\u0027 \u0026lt;ref\u0026gt; \u0026lt;/ref\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"quot;The \u0027\u0027foreskin\u0027\u0027 has two main functions. Firstly it exists to protect the glans penis. Secondly the foreskin is a primary sensory part of the penis, containing some of the most sensitive areas of the penis.\u0026quot;\u0027 - The Royal Australasian College of Physician\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The female clitoral hood is homologous with the \u0027\u0027foreskin\", \"priority\":5}]}, \"synonyms\":{}}");

