	add("foresyllable", "{\"term\":\"foresyllable\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|fore|syllable|lang\u003den}}; Compare Dutch {{m|nl|voorsyllabe}}, German {{m|de|Vorsilbe}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A syllable or syllables at the beginning of a word\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1902\u0027\u0027, \u0027Notes and Queries\u0027, John C. Francis, page 232\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"We had several things beginning with the same \u0027\u0027foresyllable\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1914\u0027\u0027, Keith Clark, \u0027The Spell of Spain\u0027, The Page Company, page 132\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0026quot; kar \u0026quot; is the same \u0027\u0027foresyllable\u0027\u0027 that runs in Carthage and means a high place\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Vivian Cook, \u0027Accomodating Brocolli in the Cemetary: Or Why Can\u0027t Anybody Spell\u0027, Touchstone, page 57\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"C is strong like to \u0026quot;k.\u0026quot; before \u0026quot;a,\u0026quot; \u0026quot;o,\u0026quot; \u0026quot;u,\u0026quot; either simple vowels, or combined in diphthongs, as cankard, cautele, concord, coward, cunning, or when it ends a \u0027\u0027foresyllable\u0027\u0027 before any other consonant as \u0026quot;c\u0026quot; \u0026quot;q\u0026quot; \u0026quot;k\u0026quot; \u0026quot;t\u0026quot; as in succede, acquaint, acknowledge, expecting\", \"priority\":7}]}, \"synonyms\":{}}");

