	add("forfeit", "{\"term\":\"forfeit\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"Middle English from ca. 1300, from Old french (842-ca. 1400) {{m|fro|forfait||crime}}, originally the past participle of {{m|fro|forfaire||to transgress}}, and Medieval Latin {{m|la|foris factum}}. During the 15th century, the sense shifted from the crime to the penalty for the crime.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A penalty for or consequence of a misdemeanor\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That he our deadly \u0027\u0027forfeit\u0027\u0027 should release\u0027 (John Milton, \u0027On the Morning of Christ\u0027s Nativity\u0027, 1629\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A thing forfeited; that which is taken from somebody in requital of a misdeed committed; that which is lost, or the right to which is alienated, by a crime, breach of contract, etc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He who murders pays the \u0027\u0027forfeit\u0027\u0027 of his own life\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Thy slanders I forgive; and therewithal / Remit thy other \u0027\u0027forfeits\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Something deposited and redeemable by a sportive fine as part of a game\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Goldsmit\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Country dances and \u0027\u0027forfeits\u0027\u0027 shortened the rest of the day\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Injury; wrong; mischief\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Ld. Berner\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"to seek arms upon people and country that never did us any \u0027\u0027forfeit\", \"priority\":12}]}, \"synonyms\":{}}");

