	add("forgery", "{\"term\":\"forgery\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"Recorded since recorded 1574; from the verb to forge, from Middle english (1100-1500) via Anglo-norman forger from Old french (842-ca. 1400) forgier, from Latin fabricari \u0026quot;to frame, construct, fabricate\u0026quot;, itself from fabrica \u0027workshop; construction\u0027, from faber \u0027workman, smith\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of forging metal into shape\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of forging, fabricating, or producing falsely; especially the crime of fraudulently making or altering a writing or signature purporting to be made by another, the false making or material alteration of or addition to a written instrument for the purpose of deceit and fraud\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Such a scandal as the prosecution of a brother for \u0027\u0027forgery\u0027\u0027—with a verdict of guilty—is a most truly horrible, deplorable, fatal thing. It takes the respectability out of a family perhaps at a critical moment, when the family is just assuming the robes of respectability:it is a black spot which all the soaps ever advertised could never wash off\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"That which is forged, fabricated, falsely devised or counterfeited\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An invention, creation\", \"priority\":5}]}, \"synonyms\":{}}");

