	add("formalism", "{\"term\":\"formalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|formal|ism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Strict adherence to a given form of conduct, practice etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One of several alternative computational paradigms for a given theory\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An approach to interpretation and/or evaluation focused on the (usually linguistic) structure of a literary work rather than on the contexts of its origin or reception\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The tendency to elevate formal above expressive value in music, as in serialism\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A particular mathematical or scientific theory or description of a given state or effect\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, \u0026amp; Jeff Forshaw, \u0027The Quantum Universe\u0027, Allen Lane 2011, p. 54\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Heisenberg seems to have been motivated by his intense annoyance that Schrödinger\u0027s more intuitive version of quantum theory was more widely accepted than his own, even though both \u0027\u0027formalisms\u0027\u0027 led to the same results\", \"priority\":7}]}, \"synonyms\":{}}");

