	add("fortitude", "{\"term\":\"fortitude\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) from Latin {{m|la|fortitūdō||bravery, strength}}, from \u0027fortis\u0027 (brave, strong)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Mental or emotional strength that enables courage in the face of adversity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1612\u0027\u0027, w:William William Shakespeare, \u0027King Henry VIII\u0027, act 3, sc. 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I am able now, methinks\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Out of a \u0027\u0027fortitude\u0027\u0027 of soul I feel\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"To endure more miseries\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"w:Jane Jane Austen, \u0027w:Lady Lady Susan\u0027, ch. 1\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I shall soon have need for all my \u0027\u0027fortitude\u0027\u0027, as I am on the point of separation from my own daughter\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1906\u0027\u0027, w:Joseph Joseph Conrad, \u0027The Mirror of the Sea\u0027, ch. 21\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"She may be saved by your efforts, by your resource and \u0027\u0027fortitude\u0027\u0027 bearing up against the heavy weight of guilt and failure\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2012 \u0027\u0027 Jan. 30, w:Fareed Fareed Zakaria, \u0026quot;[http://www.time.com/time/magazine/article/0,9171,2104842,00.html The Strategist],\u0026quot; \u0027Time\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Mitt Romney . . . charges that Obama is an appeaser who apologizes for America, lacks \u0027\u0027fortitude\u0027\u0027 and is \u0026quot;tentative, indecisive, timid and nuanced.\u0026quot\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Physical strength\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1604\u0027\u0027, w:William William Shakespeare, \u0027Othello\u0027, act 1, sc. 3\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"DUKE OF VENICE: The Turk with a most mighty preparation makes fo\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Cyprus. Othello, the \u0027\u0027fortitude\u0027\u0027 of the place is bes\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"known to you\", \"priority\":16}]}, \"synonyms\":{}}");

